import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import PrivateRoute from './components/PrivateRoute';
import Layout from './components/Layout';

// Import the Pages we just built
import Home from './pages/Home';
import About from './pages/About';

// Placeholder Pages (We will build these in the next modules)
// Keep these here so the app doesn't crash when you click links
const Login = () => <div className="container" style={{ padding: '2rem' }}><h1>Login Page</h1></div>;
const Register = () => <div className="container" style={{ padding: '2rem' }}><h1>Register Page</h1></div>;
const Cars = () => <div className="container" style={{ padding: '2rem' }}><h1>Car Listing</h1></div>;
const UserDashboard = () => <div className="container" style={{ padding: '2rem' }}><h1>User Dashboard</h1></div>;
const AdminDashboard = () => <div className="container" style={{ padding: '2rem' }}><h1>Admin Dashboard</h1></div>;
const NotFound = () => <div className="container" style={{ padding: '2rem' }}><h1>404 Not Found</h1></div>;

function App() {
  return (
    <AuthProvider>
      <Router>
        <Layout> {/* This wraps the Navbar and Footer around everything */}
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/cars" element={<Cars />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

            {/* Protected User Route */}
            <Route 
              path="/user/*" 
              element={
                <PrivateRoute roleRequired="user">
                  <UserDashboard />
                </PrivateRoute>
              } 
            />

            {/* Protected Admin Route */}
            <Route 
              path="/admin/*" 
              element={
                <PrivateRoute roleRequired="admin">
                  <AdminDashboard />
                </PrivateRoute>
              } 
            />

            {/* Catch All for 404 */}
            <Route path="*" element={<NotFound />} />
          </Routes>
        </Layout>
      </Router>
    </AuthProvider>
  );
}

export default App;
